import {useEffect, useState} from 'react';
import { Box, Button, Card, CardContent, CardHeader, Divider, TextField } from '@mui/material';
import DataService from "../service/DataService";
import AdminServices from "../service/AdminServices";



const initialFieldValues = {
    id: 0,
    firstName: "",
    lastName: "",
    email: "",
    gender: "",
    password: ""

};

export const AccountSettingsAdmin = (emailData) => {
    const [userDetails , setUserDetails] = useState(initialFieldValues);
    const [values, setValues] = useState({
        password: '',
        confirm: ''
    });

    useEffect(() =>{
        retrieveUsersDetails();
    }, []);

    const retrieveUsersDetails = () =>{
        const email = emailData;
        AdminServices.getAdmin(email).then(response => {
            setUserDetails(response.data);
            console.log(response);
        }).catch(error => {
            console.log(error)
        })

    }

    const handleChange = (event) => {
        setValues({
            ...values,
            [event.target.name]: event.target.value
        });
    };

    return (
        <>
            <Card>
                <CardHeader
                    subheader="Account Information"
                    title="Details"
                />
                <Divider />

            </Card>
        <form >
            <Card>
                <CardHeader
                    subheader="Update password"
                    title="Password"
                />
                <Divider />
                <CardContent>
                    <TextField
                        fullWidth
                        label="Password"
                        margin="normal"
                        name="password"
                        onChange={handleChange}
                        type="password"
                        value={values.password}
                        variant="outlined"
                    />
                    <TextField
                        fullWidth
                        label="Confirm password"
                        margin="normal"
                        name="confirm"
                        onChange={handleChange}
                        type="password"
                        value={values.confirm}
                        variant="outlined"
                    />
                </CardContent>
                <Divider />
                <Box
                    sx={{
                        display: 'flex',
                        justifyContent: 'flex-end',
                        p: 2
                    }}
                >
                    <Button
                        color="primary"
                        variant="contained"
                    >
                        Update
                    </Button>
                </Box>
            </Card>
        </form>
        </>
    );
};
